B.abM=new A.x("At African Straw Enterprise Ltd (ASE), we believe that every product tells a story\u2014a story of tradition, craftsmanship, and community impact. Based in the heart of Northern Ghana, we specialize in producing a variety of handcrafted Bolga baskets, each woven with care and dedication by our talented artisans. Beyond the beauty and functionality of our baskets lies a deeper purpose that drives us: empowering women and transforming communities.",null,B.au,null,null,null,null,null,null,null,null,null,null,null,null)
