B.a1R=new A.an(B.n,B.f,B.e,B.h,null,B.m,null,B.W8,null)
B.ad3=new A.x("ASE\u2019s mission is to alleviate poverty in rural communities in West Africa by creating sustainable economic opportunities, particularly for women who are often excluded from formal employment. We collaborate with over 5,000 skilled artisans, most of whom are women, providing them with the platform, training, and resources to transform their traditional weaving skills into a reliable source of income. These women, who skillfully balance their craft with family duties and farming, are the backbone of their local economies. Each basket they create embodies resilience and creativity, reflecting the strength of their communities.",null,B.au,null,null,null,null,null,null,null,null,null,null,null,null)
B.ae8=new A.x("COMMUNITY IMPACT: BUILDING FUTURES BEYOND BASKETS",null,B.c_,null,null,null,null,null,null,null,null,null,null,null,null)
B.aee=new A.x("At ASE, we believe in giving back to the communities that support us. Our commitment goes beyond employment\u2014it\u2019s about improving the quality of life. Along with providing fair wages, we implement social interventions in rural areas that lack essential amenities. A key initiative is the construction of boreholes to provide clean, safe water, a necessity in these communities. This effort has significantly improved health and well-being while freeing up time for women and children who once spent hours fetching water from distant sources. By reducing the time spent on these tasks, communities can focus on more productive activities, leading to a positive ripple effect on their development.",null,B.au,null,null,null,null,null,null,null,null,null,null,null,null)
B.acB=new A.x("SUSTAINABILITY MEETS EMPOWERMENT",null,B.c_,null,null,null,null,null,null,null,null,null,null,null,null)
B.Wo=A.a(s([B.acB]),t.p)
B.a2A=new A.an(B.n,B.f,B.e,B.h,null,B.m,null,B.Wo,null)
